import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
//import SidebarContent from './SidebarContent'; // Adjust the import path as necessary
import Dashboard from './features/pages/dashboard'; // Adjust the import path as necessary
//import TransactionHistory from './features/pages/transactionHistory'; // Adjust the import path as necessary
import Home from './features/pages/home'; // Adjust the import path as necessary
import Login from './features/pages/login'; // Adjust the import path as necessary
import Register from './features/pages/register'; // Adjust the import path as necessary
// // Adjust the import path as necessary
//import LoanRequest from './LoanRequest'; // Adjust the import path as necessary
//import LoanHistory from './LoanHistory'; // Adjust the import path as necessary
////import FundWallet from './FundWallet'; // Adjust the import path as necessary
//import SuccessTransaction from './SuccessTransaction'; // Adjust the import path as necessary
import Footer from './features/pages/footer'
import Navbar from './features/pages/navbar'

const App = () => {
  return (
     <>
     <Navbar/>
     <div className="flex">
        <Dashboard />
        <div className="flex-1 p-4">


        </div>

      </div>
      <div>
      <Footer/>
      </div>


      <Routes>
            <Route path="/" element={<Home />} />
            <Route path="/login" element={<Login />} />
            <Route path="/register" element={<Register />} />

          </Routes>

     </>

  );
};

export default App;
